import React, {useContext} from 'react';
import imagesContext from './Gallery';

const Image = () => {
  const imageUrls = useContext(imagesContext);

  return (
    <div>
      <p>{imageUrls}</p>
      <img src={imageUrls.firstUrl}></img>
    </div>
  )
}

export default Image;
